'use strict';
let AGetPersistentSessionCommand = require('./AGetPersistentSessionCommand.js');
let MessageType = require('./MessageType.js');
let TransportMessageType = require('./TransportMessageType.js');
//@@DocBrief("The command for getting trading session")
class GetTradingSessionCommand extends AGetPersistentSessionCommand {
    constructor() {
        super();
        this.commandName = "GetTradingSessionCommand";
    }
    getRealMessageType() {
        return MessageType.GetTradingSession;
    }
    getEmptyMessageType() {
        return MessageType.GetEmptyTradingSession;
    }
    getTransportMessageType() {
        return TransportMessageType.GetTradingSessionStatus;
    }
}
module.exports = GetTradingSessionCommand
